import React from 'react';
import Tab from './Tab';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faThLarge,faChartbar,faClone} from '@fortawesome/free-solid-svg-icons';

const Leftbox = () => {
  return (
       <>
        <Tab icon={faThLarge}
        title="Dashboard"/>
        <Tab icon={faChartbar}
        title="Sidebar Type"/>
        <Tab icon="faClone"
        title="Page Layouts"/>
       </>
  );
};

export default Leftbox;
